import Link from "next/link";
import { func } from "prop-types";

export default function Navbar() {
  return (
    <nav>
      <Link href="/about">About</Link>
      <Link href="/users">Users</Link>
      <Link href="/contact">Contact</Link>
    </nav>
  );
}
